/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `game_lists` (
  `id` int NOT NULL AUTO_INCREMENT,
  `number_group` varchar(255) NOT NULL,
  `rank_num_player` int NOT NULL,
  `player_group_id` int NOT NULL,
  `system_id` int NOT NULL,
  `title_id` int NOT NULL,
  PRIMARY KEY (`id`),
  KEY `game_list_player_group_id` (`player_group_id`),
  KEY `game_list_system_id` (`system_id`),
  KEY `game_list_title_id` (`title_id`),
  CONSTRAINT `game_lists_ibfk_1` FOREIGN KEY (`player_group_id`) REFERENCES `players` (`id`),
  CONSTRAINT `game_lists_ibfk_2` FOREIGN KEY (`system_id`) REFERENCES `system` (`id`),
  CONSTRAINT `game_lists_ibfk_3` FOREIGN KEY (`title_id`) REFERENCES `titles` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3840 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
